function range(a,b){for(var c=[],d=a;d<=b;d++)c.push(d);return c}function chooseValue(a,b,c){if(0===b&&!c||0===a.length)return 0;var d=0;return $.each(a,function(a,c){if(b<c.key)return d=c.value,!1}),d}function speciesList(a){var b="<ul>";return $.each(a,function(a,c){b+='<li><a href="http://www.gbif.org/species/'+c.key+'" title="show in gbif" target="_blank">'+c.name+"</a></li>"}),b+"</ul>"}